import React, {Component} from 'react';
import './App.css';
import Auth from './components/Auth'
import { Switch, Route } from "react-router-dom";



class App extends Component {
  constructor(){
      super()
      this.state = {}
  }

  render(){
      return (
          <div className="App">
              <Switch>
                  <Route 
                      exact path="/" 
                      render={rProps => 
                          <Auth {...rProps}/>
                      }/>
              </Switch>
          </div>
      )
  }
}

export default App


